import styled from "styled-components/native";

export const First = styled.View`
    flex-direction: row;
    align-items: center;
`;

export const BackupTxt = styled.Text`
    font-family: 'Roboto';
    font-style: normal;
    font-weight: 300;
    font-size: 18px;
    letter-spacing: -0.333333px;
    color: #C3AD60;
`
